import React, { useState } from "react";
import RoomData from "./Room";

const RoomContextProvider = ({children}) => {

    const [Data, setData] = useState(null);

    return(
        <RoomData.Provider value={{Data,setData}}>
        {children}
        </RoomData.Provider>
    )
}

export default RoomContextProvider
